import StrokedText from "./StrokedText";

function MenuDiv(props) {
    return (
        <div style={{backgroundColor: "rgba(0,0,0,0.5)", width: "26vw", height: "30vw", margin: "2vw"}}>
            <StrokedText>{props.title}</StrokedText>
        </div>
    )
}

export default MenuDiv;
